BEGIN TRANSACTION;
CREATE TABLE "stadium"
(
	Name string primary key,
	city string,
	country string,
	capacity int
);
CREATE TABLE "android_metadata" ("locale" TEXT DEFAULT 'en_US');
CREATE TABLE "Winner_Of" (
	`EventID`	int,
	`GoldWinnerId`	INTEGER,
	`SilverWinnerId`	INTEGER,
	`BronzeWinnerId`	INTEGER,
	FOREIGN KEY(`EventID`) REFERENCES `Event`(`_Id`),
	FOREIGN KEY(`GoldWinnerId`) REFERENCES `Athlete`(`_Id`),
	FOREIGN KEY(`SilverWinnerId`) REFERENCES `Athlete`(`_Id`),
	FOREIGN KEY(`BronzeWinnerId`) REFERENCES `Athlete`(`_Id`)
);
CREATE TABLE "Summer_Olympics" (
	`Name`	string,
	`Country`	String,
	`Year`	int,
	`Location`	string,
	`ID`	INTEGER PRIMARY KEY AUTOINCREMENT
);
CREATE TABLE "EventAthlete" (
	`EventId`	INTEGER,
	`AthleteId`	INTEGER,
	FOREIGN KEY(`EventId`) REFERENCES `Event`(`_Id`),
	FOREIGN KEY(`AthleteId`) REFERENCES `Athlete`(`_Id`)
);
CREATE TABLE "Event" (
	`Id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`Sport`	TEXT,
	`Temperature`	INTEGER,
	`Humidity`	INTEGER,
	`StadiumName`	TEXT,
	`OlympicId`	INTEGER,
	`Discipline`	TEXT,
	FOREIGN KEY(`StadiumName`) REFERENCES `Stadium`(`_name`),
	FOREIGN KEY(`OlympicId`) REFERENCES `Summer_Olympics`(`_Id`)
);
CREATE TABLE "Athlete" (
	`id`	INTEGER PRIMARY KEY AUTOINCREMENT,
	`name`	TEXT,
	`country`	TEXT,
	`gender`	TEXT,
	`date_of_birth`	TEXT,
	`height`	REAL,
	`weight`	REAL,
	`sport`	TEXT
);
